import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

class CreateRoomButton extends React.Component {


	componentDidMount() {
		console.log('rendered for the first time!');
	}

	render() {
	  return (
		<button className ="create-room-btn">
			Create Room 
		</button>
	);
	}

}

class JoinRoomButton extends React.Component {

	componentDidMount() {
		console.log('rendered for the first time join room.!');
	}

	render() {
		return (
			<button className= {this.props.className}>
				Join Room
			</button>
		)

	}
}


function App() {
	return (
		<div className= "index-btns">
			<CreateRoomButton className= "create-room-btn"/>
			<JoinRoomButton className ="join-room-btn"/>
		</div>
	);

}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
